"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\n[Kansallisarkiston ja SSHY:n filmist\u00e4 puuttuivat sivut 250-251, joilla ovat kastetapahtumat noin 18.6.1819-31.8.1819.]<br />\nPyh\u00e4j\u00e4rvi Vpl - Pyh\u00e4j\u00e4rvi Vib l<br />\nKastetut<br />\nLinkki t\u00e4h\u00e4n tapahtumaan [ 6517840 ]\thttps://hiski.genealogia.fi/hiski?fi+t6517840<br />\nSyntynyt / Kastettu\t13.7.1819\t14.7.1819<br />\nKyl\u00e4 / Talo\tYll\u00e4j\u00e4rvi<br />\nIs\u00e4\tBd.\tJohan\t \tHiiri<br />\n\u00c4iti\t \tMaria\t \tKucko\t35<br />\nLapsi\tJohan\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://hiski.genealogia.fi/hiski?fi+t6535153\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.geni.com/photo/view/6000000035675979876?album_type=photos_of_me&amp;end=&amp;photo_id=6000000061169708232<br />\n\t\"SAND LAKE - John Ellis Williams of Sand Lake, formerly of Cadillac and Lake City, died Tuesday, Sept. 5, 2000 at Kent Community Hospital in Grand Rapids. He was 85.<br />\n\tMr. Williams was born July 3, 1915 in Jennings to John Ramo and Lempi (Pulkkinen) Williams. He married Thelma Rosted Dec. 21, 1935 in Lake City. She preceded him in death July 14, 1999.<br />\n\tHe owned and operated a potato warehouse in Lake City in the mid- and late 1930s. He later worked for several contractors in Michigan, building roads and was an excellent mechanic, repairing heavy road machinery. He and his wife helped to establish and build new churches in various communities in the U.S. and they were active in church work.<br />\n\tSurvivors include his daughter, Myrna Vaska of Seattle; son Tauno (Lois) Williams of Sand Lake; 10 grandchildren; brothers, Wells (Elaine) Williams, and Rudolf (Lucille) Williams; sisters, Bertha (Frank) Rosted, and Mayme Guthrie; and other relatives.<br />\n\tHe was also preceded in death by his parents; son-in-law Karlis Vaska; sister, Elsie Crawford; brothers, Otto and Arthur Williams; and several brothers-in-law and sisters-in-law.<br />\n\tCremator has taken place. Services are Sunday at the Rockford Springs Community Church in Greenville. Interment will be at Lake City.<br />\n\tMemorial contributions may be made to the Rockford Springs Community Church or St. John's Lutheran Church in Lake City.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
