"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://orivesi.fi/wp-content/uploads/2020/06/Orivesi_ROYK_Rakennetun_ympariston_selvitys_2010_sivut_3.pdf<br />\nL\u00e4ngelm\u00e4ell\u00e4 \"sotilasvirkataloja oli 1600-luvun lopulla Er\u00e4slahden Knuutila, Solttilan yksin\u00e4istalo sek\u00e4 Kirjasniemen yksin\u00e4istila\".\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://orivesi.fi/wp-content/uploads/2020/06/Orivesi_ROYK_Rakennetun_ympariston_selvitys_2010_sivut_6.pdf<br />\n\"Er\u00e4slahden kyl\u00e4n talot ovat maarekisteriss\u00e4 numeroitu: 1 Nuuttila, 2 Yrk\u00f6l\u00e4, 3 Sepp\u00e4l\u00e4 ja 4 Kultala.<br />\nL\u00e4ngelm\u00e4en seudun historia II:n mukaan Knuutilan talo halottiin vuonna 1727 kahteen osaan, joista toinen Heikkil\u00e4 ja toista ei nimetty.<br />\nMaarekisterin mukaan Knuutilan tila halottiin kahteen osaan, Heikkil\u00e4 ja Jussila, vuonna 1867. Jussilan kohdalla teksti: Tilusvaihto talon 3 kanssa ja isojaon t\u00e4ydennys vahvistettu 1899, alan muutos.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
