"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/pauhari.htm#Taulu%2071<br />\n\"Taulu 71<br />\n... Maria Samuelsdotter Barck syntynyt noin 1687, kuollut 8.8.1729 Urjala.<br />\nVanhemmat: Samuel Ericsson Barck, Katselmuskirjuri, syntynyt Sverige, Uppsala, Litslena, kuollut j\u00e4lkeen 1706. Pakolaisluetteloissa mainitaan 7095 Anna Christina Barck, RegtzQwartermest. Ea l: nej. gm: Floor, Regementsqwartermestare. d: 19.3.1712. Siis kuka? Matti Valta esitt\u00e4\u00e4 teoksessaan L\u00e4\u00e4ninhallinnon virkamiehet 1721-1808 katselmuskirjuri Samuel Barckin lapsiksi Danielin, Samuelin ja Johanin. <br />\n...<br />\nMainitaan v. 1706 S\u00e4\u00e4ksm\u00e4en k\u00e4r\u00e4jill\u00e4 h\u00e4radskrifvare w\u00e4lb. Samuel Barck. Todistajana ratsumestari Gustaf Rutenhielmin edesmenneen is\u00e4n luutnantti Georg Rutenhielm pes\u00e4n ja edesmenneen everstiluutnantti Hans Johan B\u00e4ckin pes\u00e4n v\u00e4lisess\u00e4 asiassa. Johanna Ericsdotter Ancherus, syntynyt noin 1645 Iitti, kuollut j\u00e4lkeen 14.4.1722. Mainitaan kummina Urjalassa Kokolla 14.4.1722 Maria Barck med des moder Johanna Anchera. Urjalan historia -kirjassa (Araj\u00e4rvi Osa 1 ja sivu 42). Kerrotaan, ett\u00e4 h\u00e4n majoitti isovihan aikana ylioppilas ja sissi Christian Hammaria kuuden viikon ajan. (Johanna on siin\u00e4 rykmentinkirjurin leski Johanna Ancker).<br />\n...<br />\nKokon Karppilassa v. 1727 l\u00e4nsman Gabriel Mexberg, v. 1728 l\u00e4nsman Gabriel Mexberg, Valborg syster, Johan Forsman (?) m\u00e5g. V. 1731 afsked quartermestare Abraham Alftan, Eva Helena fru.<br />\nPerunkirjoitus 11.1.1742 efter l\u00e4nsman Gabriel M\u00e4xberg, 8.8.1729 aflidne hru Maria barck.<br />\nUrjalan k\u00e4r\u00e4j\u00e4t 21.-23.1.1736: H\u00e4radskrifvare Daniel Barck, des numera aflidne syster Maria Barck och des \u00e4ven framledne f\u00f6rsta man l\u00e4nsman Thomas Saleens qvarl\u00e5tna barn son Samuel Saleen, tw\u00e5 d\u00f6ttrar Johanna och Ester Saleen, Maria Barck sedermera varit gift med l\u00e4nsman Gabriel M\u00e4xberg, Johanna Saleens man rusth\u00e5llare sonen David J\u00f6ransson ifr\u00e5n Ikaala.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/pauhari.htm#Taulu%2071\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/pauhari.htm#Taulu%2071<br />\n\"Taulu 71<br />\nIII Thomas Grelsson Heikkil\u00e4, Salenius, (Taulusta 65, is\u00e4 Grels Heikkil\u00e4) Nimismies, syntynyt noin 1680 Urjala, Huhti, Heikkil\u00e4, kuollut 18.3.1722 Urjala, Kokko. Urjalan Kokon Karppilan tilan is\u00e4nt\u00e4 1713-22. Mainitaan sisarensa lapsen kummina Akaan Kuusjoen Rossilla vuonna 1713 scholaris Thomas Gregorii.<br />\nUrjalan k\u00e4r\u00e4j\u00e4t v. 1737: bokh\u00e5llare Petter Johan Austrell Turun kauppias Hans Schelen, lesken Margareta C. Schelen ja perinkunnan puolesta vaatii nimismies Gabriel M\u00e4xbergilt\u00e4 velkaa jonka des numera afledne Anteressor Matrimonii l\u00e4nsman Thomas Saleen on tehnyt. Mainitaan Hans Schelen v\u00e4vy handelsman i \u00c5bo Carl Magnus Siercken.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/pauhari.htm#Taulu%2072<br />\n\"Taulu 71<br />\nIII Thomas Grelsson Heikkil\u00e4, Salenius...<br />\n... Urjalan k\u00e4r\u00e4j\u00e4t 21.-23.1.1736: H\u00e4radskrifvare Daniel Barck, des numera aflidne syster Maria Barck och des \u00e4ven framledne f\u00f6rsta man l\u00e4nsman Thomas Saleens qvarl\u00e5tna barn son Samuel Saleen, tw\u00e5 d\u00f6ttrar Johanna och Ester Saleen, Maria Barck sedermera varit gift med l\u00e4nsman Gabriel M\u00e4xberg, Johanna Saleens man rusth\u00e5llare sonen David J\u00f6ransson ifr\u00e5n Ikaala.<br />\nTaulu 72<br />\nIV Johanna Thomasdotter Salenius, (Taulusta 71, is\u00e4 Thomas Salenius) syntynyt 18.8.1714 Urjala, Kokko, Karppila, kuollut 27.4.1760 Urjala, Ikaala.\t<br />\nPuoliso: Vihitty 26.12.1734 S\u00e4\u00e4ksm\u00e4ki, Rudala David J\u00f6ransson Isotalo Talollinen, syntynyt 6.1.1704 Urjala, Ikaala, Isotalo, kuollut 31.3.1765 Urjala, Ikaala.<br />\nVanhemmat: J\u00f6ran Davidsson Isotalo, Rusthollari, syntynyt noin 1666, kuollut 21.7.1741 Urjala,Ikaala. Is\u00e4nt\u00e4n\u00e4 1704-1737. Mainitaan SAYssa ensimm\u00e4isen kerran v. 1705.<br />\nPerunkirjoitus 22.6.1742 Ikaala rusth\u00e5ll framledne rusth\u00e5llare J\u00f6ran Davisson, enka Maria Carlsdotter, tre s\u00f6ner David, Carl och Jacob, tv\u00e4nne d\u00f6ttrar Kirstin gift med rusth\u00e5llare Jacob Henricsson ifr\u00e5n Menois Mattila, Maria J\u00f6ransdotter 25 \u00e5r. Sonen Carl \u00e4r borgare i \u00c5bo. Velkoja Thomas Thomasson Rauko i Risikkala by, Thomas Henricsson ibm.<br />\nUrjalan k\u00e4r\u00e4j\u00e4t 28.11.1761 \u00a717: rusth\u00e5llare Jacob J\u00f6ransson ifr\u00e5n Kockois, syster rusth\u00e5llare \u00e4nka Kirstin J\u00f6ransdotter i Menois, arfskifte efter theras aflidne fader rusth\u00e5llare J\u00f6ran Davidsson Ikaala, efterl\u00e4mnade \u00e4nka Maria Carlsdotter, broder rusth\u00e5llare David J\u00f6ransson, afledne syster Maria J\u00f6ransdotter, broder b\u00e5rgare i \u00c5bo stad Carl J\u00f6ransson Ikalin. Vihitty noin 1702 Urjala, V\u00e4lkkil\u00e4. Maria Carlsdotter Isotalo, syntynyt 24.3.1680 Urjala, V\u00e4lkkil\u00e4, Isotalo, kuollut 3.4.1761 Urjala, Ikaala. Is\u00e4nt\u00e4n\u00e4 1737-1765.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
