"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nP\u00e4\u00e4telty ett\u00e4 t\u00e4ss\u00e4 haudattiin 1737 kuolleen Peter N\u00e4ri\u00e4isen leski, ja jos Peterill\u00e4 oli useampia kuin yksi puoliso niin t\u00e4ss\u00e4 kai haudattiin h\u00e4nen viimeisin puolisonsa. Peter Petersson N\u00e4ri\u00e4isen \u00e4iti oli h\u00e4nen hautaustapahtumansa omaismerkinn\u00e4n mukaa Maria P\u00e4rssinen. T\u00e4h\u00e4n ei ole merkitty vainajan nime\u00e4. Haudattinko t\u00e4ss\u00e4 Maria vai Walborg? Rippikirjassa 1737-1747 on kuolleeksi merkittyn\u00e4 ja yliviivattuna \"Peter N\u00e4rj\u00e4is enka Walborg\", ja t\u00e4m\u00e4 tapahtuma sopii siihen aikav\u00e4liin. On my\u00f6s mahdollista ett\u00e4 Peter N\u00e4ri\u00e4isell\u00e4 oli vain yksi puoliso, jonka oikea nimi j\u00e4\u00e4 h\u00e4m\u00e4r\u00e4ksi koska joko Maria tai Walborg on v\u00e4\u00e4r\u00e4 nimi:<br />\nPyh\u00e4j\u00e4rvi Vpl - Haudatut<br />\nLinkki tapahtumaan\thttps://hiski.genealogia.fi/hiski?fi+t6473176<br />\nKuollut / Haudattu\t \t30.5.1742<br />\nKyl\u00e4 / Talo\tCachwenitza\t <br />\nVainaja\tea\t \t \t <br />\nKuolinsyy / Ik\u00e4\t \t54 v<br />\nOmainen\t \tPeter\t \tN\u00e4ri\u00e4in\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
