"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPihlajaveden historiaa - Nuijasodasta isoonvihaan ja suuriin kuolonvuosiin l\u00e4hteest\u00e4 https://www.geni.com/projects/Pihlajaveden-historiaa/45699<br />\n\"... Ensimm\u00e4isen kerran Simsi\u00f6n kyl\u00e4 ja sen nelj\u00e4 taloa mainitaan vuoden 1567 Ruoveden pit\u00e4jien verokirjassa. Kyl\u00e4n nimen\u00e4 on Simsi\u00f6, joten on selv\u00e4\u00e4, ett\u00e4 yksi noista nelj\u00e4st\u00e4 talosta oli Simsi\u00f6, is\u00e4nt\u00e4n\u00e4\u00e4n Pekka H\u00e4rk\u00f6nen. Pihlajaveden seurakunnan historia pit\u00e4\u00e4 todenn\u00e4k\u00f6isen\u00e4, ett\u00e4 kolme muuta taloa olivat Kolehma, Reinikka ja Somppi... Kolehman taloon tuli 1660-luvulla is\u00e4nn\u00e4ksi tulokas Sigfrid Matinpoika K\u00f6ntter, mink\u00e4 j\u00e4lkeen Kolehman talosta tuli virallisesti K\u00f6ntt\u00e4ri, jonka rinnalla aiempikin nimi s\u00e4ilyi...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
