"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://jknieminen.vuodatus.net/lue/2018/04/pukkalasta-junteriin<br />\n\"... Talvik\u00e4r\u00e4jill\u00e4 1765 esitettiin toisenlainen totuus Pukkalasta. Eronnut ruotusotamies Matti Simonpoika Ansenlig kertoi, ett\u00e4 h\u00e4nen \u00e4itins\u00e4 is\u00e4 Kalle Yrj\u00f6npoika Lukkari oli luovuttanut Lukkarin talon Hermanni Matinpojalle sill\u00e4 ehdolla, ett\u00e4 Hermanni el\u00e4tt\u00e4\u00e4 Kallen t\u00e4m\u00e4n kuolemaan saakka ja ett\u00e4 Hermannin poika ja Anna Kallentyt\u00e4r menev\u00e4t naimisiin. Ansenligin mukaan Hermanni ei kuitenkaan noudattanut sopimusta, vaan h\u00e4\u00e4ti Kallen eik\u00e4 antanut poikansa kihlata Annaa...<br />\nVaikka Ansenligin perhe ei menestynyt k\u00e4r\u00e4jill\u00e4 saamme joka tapauksessa Matin aktiivisuuden ansiosta lis\u00e4t\u00e4 Lukkarin lapsiin Anna Kallentytt\u00e4ren (s.n. 1700, k. 18.5.1753), joka asui 1730-50-luvulla Tehin Tapanilassa. Tehin Tapanilassa oli 1730-luvulla my\u00f6s Aune Kallentyt\u00e4r, joka muutti sielt\u00e4 Junteriin. Voi olla, etteiv\u00e4t t\u00e4ss\u00e4k\u00e4\u00e4n ole viel\u00e4 kaikki Kallen lapset...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
