"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://karin.kapsi.fi/Esivanhemmat/15-1793.htm<br />\n\"Sipi Sepp\u00e4 ( taulu ) - Ruoveden \u00c4ht\u00e4rin Hankaveden kyl\u00e4n Hankolan (M\u00e4ki eli Hankom\u00e4ki) sepp\u00e4 ja ensimm\u00e4inen is\u00e4nt\u00e4 2 \u00e4yrin talossa 1567-1585. Mainitaan viel\u00e4 1589.<br />\n    Vuoden 1589 maantarkastuskirjan mukaan taloa oli aloitettu rakentaa 1556 entiselle Pirkkalan Messukyl\u00e4n er\u00e4maalle. Vuoden 1571 hopeaveroluettelon mukaan h\u00e4n omisti 15 naulaa kuparia, yhden 10 markan arvoisen tamman, 3 lehm\u00e4\u00e4, 5 lammasta, yhden sian ja 2-vuotista karjaa yhden. Hopeaveroa h\u00e4n maksoi 5 markkaa, 6 \u00e4yri\u00e4 ja 12 penninki\u00e4.<br />\n    Maantarkastuskirjan 1589 mukaan Hankaveden kyl\u00e4ss\u00e4 oli hyv\u00e4t kalavedet, hirsi- ja polttopuumets\u00e4t sek\u00e4 karjalaitumet; myllyj\u00e4 ei Hankavedell\u00e4 ollut. Sipill\u00e4 oli 1 tynnyrin kylv\u00f6 ja 1 aamin niitty. Sipi omisti 3 lehm\u00e4\u00e4 ja 2 hevosta; nahkoja h\u00e4nell\u00e4 ei mainita olleen. Miesapua sanotaan olleen 1 henkil\u00f6n.<br />\n    Ruoveden k\u00e4r\u00e4jill\u00e4 30.12.1577 tuomittiin Mikko V\u00e4tti Ouluvedelt\u00e4 armotta 6 markan sakkoon, koska oli tehnyt 2 kertaa vahinkoa Sipi Hangon (Sigfrid Hangas) takamaalla. Ruoveden k\u00e4r\u00e4jill\u00e4 1.7.1580 tuomittiin Heikki Himainen 6 markan sakkoon kahdesta mustelmasta, jotka h\u00e4n oli ly\u00f6nyt Sipi Sepp\u00e4\u00e4n Hangossa.<br />\n...<br />\nL\u00e4hteet:<br />\nMatti J. Kankaanp\u00e4\u00e4: Vanhan Ruoveden Talonhalijat matrikkeli 1552-1809. Jyv\u00e4skyl\u00e4 1990.<br />\n677 Hankola (M\u00e4ki eli Hankom\u00e4ki) (1) sivu 224 ...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://hiski.genealogia.fi/seurakunnat/srk?CMD=SRK&amp;ID=493&amp;TYPE=HTML&amp;LANG=FI\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\n\"Oriveden k\u00e4r\u00e4j\u00e4t 27-28.6.1662 i L\u00e4ndzmans G\u00e5rden S\u00e4yn\u00e4jokj<br />\n VA Yl\u00e4-Satakunta KOa5 s. 621v-, mf ES 2000<br />\n...<br />\ns 625v - Efter bokh\u00e5llarens Erich Nilsons breff af 13.6.1662 f\u00f6rmantes allmogen att f\u00f6rf\u00e4rdiga alla allmenne w\u00e4gar och broar.<br />\nEfter brofougden Hinrich Ikalles besw\u00e4ran sakf\u00e4lltes f\u00f6lliande persohner f\u00f6r det, de icke hafwa fullgiort sitt arbete wedh alm\u00e4nna w\u00e4gens reparation: ...,  Cuorewesi cappelgield P\u00e4skyl\u00e4 Johan Johansson och Markus Cnutsson, Syfw\u00e4j\u00e4rf Michel Clemetsson och Bertil Marcusson, Wilkil\u00e4 M\u00e5rthen Johansson, Calku Mats Matsson, Efw\u00e4j\u00e4rfwi Agustin Erichsson och J\u00f6ran Matsson, Kusj\u00e4rfwi Bengt Michelsson, K\u00e5lhi J\u00f6ran Thomasson, Huikuri J\u00f6ran Bengtsson, Suinula M\u00e5rthen, Thomas Bengtsson, P\u00e5l Johansson och Bertil Cnutsson, Eskoila Johan Thomasson, Kawala Jacob Eskilsson, Ry\u00f6tt\u00e4 Lukas Eskilsson, W\u00e4ss\u00e4ri Olof Larsson, Koldila Simon Josepsson, Sigfridh Bertilsson och Mats Matsson, Laxi P\u00e5l J\u00f6ransson, Joensu Markus Michelsson, Ylewesi Thomas Hinrichsson, Kerte Hinrich Clemetsson, Staffan Johansson och J\u00f6ran Cnutsson, Lapiniemi Frantz Larsson, Martila Erich Knutsson.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\n\"Oriveden syysk\u00e4r\u00e4j\u00e4t 6.10.1662 S\u00e4yn\u00e4joen nimismiehentalossa<br />\n VA Yl\u00e4-Satakunta KOa5 s. 666v-, mf ES 2000<br />\n...<br />\ns 667 ... <br />\nCnuth Brusiusson i Martila ifr\u00e5n Kuorewesi bek\u00e4nde, att den tijden han tiente hos P\u00e5\u00e5ll H\u00e5kansson i Jarala, hwilket hemman Hinrich Claasson nu possiderar, hafwer K\u00e5psama medh P\u00e5\u00e5ll H\u00e5kansson huggit tillsammans swedh i be:te landh.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://urn.fi/urn:nbn:fi:sks-dor-000319\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
