"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Langelmaentuomiokirjoja.pdf<br />\nSivu 38<br />\n\"L\u00e4ngelm\u00e4en ym. syysk\u00e4r\u00e4j\u00e4t 1-3.9.1725<br />\nKts. L\u00e4ngelm\u00e4en talvik\u00e4r\u00e4j\u00e4t 1755, HMA S\u00e4\u00e4ksm\u00e4ki 16, s 260, 274v <br />\n...<br />\nAnno 1725 d:n 1. 2 och 3 Septembr h\u00f6lts - - h\u00f6steting af L\u00e4ngelm\u00e4ki - - . Sedan upwiste Anders Klemetsson ifr\u00e5n Kyllin\u00e5ija tillika med Anders J\u00f6ranssons fullm\u00e4chtig kl\u00e5ckaren Salomon Abrahamsson Mustelinus et contract, som Klemetsson om sit skatteh:ns besittning d\u00e4rst\u00e4des med Anders J\u00f6ransson 5.4.1725 upr\u00e4ttadt och kyrckioherden mag. Henricus Lillius j\u00e4mte kl\u00e5ckaren Salomon Mustelinius s\u00e5som witne underskrifwit, lydande:<br />\nWij underben\u00e4mnde hafwa - - om possessionen af Kyllenoja sk.h:n s\u00e5dant contract ing\u00e5ngit, at iag Anders Klemetsson, som h\u00e4rtil warit \u00e4gare, utf\u00e4ster, at Anders J\u00f6ransson, som sig nu \u00e4rnar at tr\u00e4da i \u00e4chtenskap med min dotter Kirstin Andersd:r, i anseende dertil at han Anders kommer til at ophielpa hemmanet ifr\u00e5n des olycka uti r\u00e5kade slatte tilst\u00e5nd, skal, s\u00e5 framt min enda son Grels Andersson mig \u00f6fwerlefwer, med denne min son besitta Kyllinoja h:n til h\u00e4lften, s\u00e5 at de andre mine barn skola l\u00e5ta sig therifr\u00e5n utl\u00f6sa, - -. \"\n</p>\n<p>\nSivu 43-44<br />\n\"L\u00e4ngelm\u00e4en ja Keuruun syysk\u00e4r\u00e4j\u00e4t 14-16.10.1730<br />\nHMA S\u00e4\u00e4ksm\u00e4ki 6, mf ES 3368<br />\n...<br />\ns 4v - Den \u00bd deel af Kyllin\u00e5ja skatteh:net, som b:n Anders Klemetsson til sin sw\u00e4rson b:n Anders J\u00f6ransson 5.4.1725 medelst ett contract, som tagit 1.9.1725 uti denne r\u00e4tts protocoll, upl\u00e5tit, blef tredie g\u00e5ngen utan klander opbuden.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
