"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\n\"Oriveden ja Kuoreveden talvik\u00e4r\u00e4j\u00e4t 14-16.1.1751<br />\n VA Yl\u00e4-Satakunta KOa69 s. 33-, mf JK 1687 <br />\n...<br />\ns. 49v - Upwistes en f\u00f6reningsskrift emellan n\u00e4mdemannen Hendrick Andersson ifr\u00e5n Wessari och dess hel och halfsyskon.\"\n</p>\n<p>\n\"Oriveden ja Kuoreveden syysk\u00e4r\u00e4j\u00e4t 3-.9.1761<br />\n VA Yl\u00e4-Satakunta KOa83 s. 1843-, mf JK 2339<br />\nN\u00e4mndem\u00e4n: Johan Olofsson Kollhi i Safwo, Mats Johansson Jussila i Kauppila, J\u00f6ran Ericksson Mulli fr\u00e5n Lasoila, Henrik Andersson Wessari, J\u00f6ran J\u00f6ransson Yri\u00f6l\u00e4 fr\u00e5n Wilkil\u00e4, Lars Johansson Pafwola fr\u00e5n denne by, Mats Mickelsson Karpila fr\u00e5n S\u00e4yn\u00e4j\u00e5ki och Johan Matsson Bertula fr\u00e5n K\u00e5ckila.\"\n</p>\n<p>\n\"Oriveden ym. talvik\u00e4r\u00e4j\u00e4t 9-.2.1964<br />\n VA Yl\u00e4-Satakunta KOa87 s. 71v-, mikrofilmi JK 1703<br />\n- uti tingshuset i Orihwesi by - - N\u00e4mndem\u00e4n: J\u00f6ran Ericsson Mulli fr\u00e5n Lasola, Henric Andersson Wessari, Lars Johansson Pawola fr\u00e5n denne by, Johan Olowsson Kolhi fr\u00e5n Sawo, Mats Michelsson Karpi fr\u00e5n S\u00e4yn\u00e4joki, J\u00f6ran J\u00f6ransson Yrj\u00e4l\u00e4 fr\u00e5n Wilkil\u00e4, Mats Johansson Jussila fr\u00e5n Kaupila och Jacob Jacobsson fr\u00e5n B\u00e5rg\u00e4rla.\"\n</p>\n<p>\n\"Oriveden ym talvik\u00e4r\u00e4j\u00e4t 17-20.2.1766<br />\n VA Yl\u00e4-Satakunta KOa91 s. 289v-, mf JK 1707-1708<br />\nN\u00e4mdem\u00e4n: J\u00f6ran Eriksson Mulli fr\u00e5n Lasola, Henrik Andersson Wessari, Lars Johansson Pafwola fr\u00e5n Oriwesi by, Matts Mickelsson Karpila fr\u00e5n S\u00e4yn\u00e4joki, J\u00f6ran J\u00f6ransson Yrj\u00f6l\u00e4 fr\u00e5n Wilckil\u00e4, Matts Johansson Jussila fr\u00e5n Kaupila och Jacob Jacobsson fr\u00e5n Borgerla.\"\n</p>\n<p>\n\"Oriveden ym. syysk\u00e4r\u00e4j\u00e4t 24-.11.1768<br />\n VA Yl\u00e4-Satakunta KOa96 s. 681-, mf JK 1714<br />\nN\u00e4mdem\u00e4n: Matts Johansson Kaupila ifr\u00e5n Er\u00e4j\u00e4rfwi, Henric Andersson Wessari ifr\u00e5n Wessari, Lars Johansson Pafwola ifr\u00e5n Orihwesiby, J\u00f6ran J\u00f6ransson Wilckil\u00e4, Matts Mickelsson Karpila ifr\u00e5n S\u00e4yn\u00e4joki, Jacob Jacobsson Ylinen ifr\u00e5n Borgerla, Johan Henricsson Tilsa ifr\u00e5n Safwo och Esaias Ericsson Antila ifr\u00e5n Pitk\u00e4j\u00e4rfwi.\"\n</p>\n<p>\n\"Oriveden ym talvik\u00e4r\u00e4j\u00e4t 1-5.3.1770<br />\n VA Yl\u00e4-Satakunta KOa98 s. 295-, mf JK 1715<br />\nN\u00e4mndem\u00e4n: Matts Johansson Kaupila fr\u00e5n Er\u00e4j\u00e4rwi, Lars Johansson Pafwola fr\u00e5n Orihwesi by, J\u00f6ran J\u00f6ransson Wilckil\u00e4, Matts Mickellsson Karpila fr\u00e5n S\u00e4yn\u00e4joki, Jacob Jacobsson Ylinen fr\u00e5n Borgerla, Johan Henriksson Tilsa fr\u00e5n Safwo och Esajas Eriksson Antila fr\u00e5n Pitk\u00e4j\u00e4rwi, men n\u00e4mndeman Henric Andersson Wessari anm\u00e4ltes wara siuk.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
