"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Langelmaentuomiokirjoja.pdf<br />\n\"Kulsialan syysk\u00e4r\u00e4j\u00e4t 26.9.1509<br />\n(s 297) Anno dnj m dnono onsdagen nest effter sti matz dag (26.9.1509) tha war h\u00f6st ting med almwgen i kulsiala soken i vskialaby<br />\nn\u00e4mpnden: morten laurisson ladickala, hans oleffsson sotala, henric matzson ibidem, jons laurisson ladickala, jons henricsson ickala, oleff laurisson kolienp\u00e4, michel andersson kotila, lauri henricsson m\u00e4lkis, per laurisson kocpap\u00e4, lauri henricsson ladickala, jons laurisson ibidem, per andersson actj<br />\n- D\u00f6mdes oleff oleffsson i vhinemj ffri f\u00f6r thz tiuffri som anders henricsson ibidem f\u00f6r vitade honom och framdelis anders henricsson sak til iij (marker) f\u00f6r orette k\u00e4r effter xii:a ranzacan<br />\n- D\u00f6mdes anders henricsson i vhinemj viij faar igen wtoff oleff oleffsson ibidem som hans hundh beth ihiel och framdelis oleff oleffsson for sak til iij (marker) for hund beet effter xii:a ranzacan\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=31785&amp;pnum=124\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\"IIa (Kulkas) OLAVI mk 1553-84, pm 1558-70, \u00e4v 1553: 1\u00bd, 1557: 2, 1562: 1\u00bd, 1566: 2. Lv 1556-59: 3\u00bd-5-5-4, 1561-62: 4\u00bd-6, 1564-70 ka 3 2/7. Oluff (Oleff) Kulkas (Kulckas, Kulchas) mk 1553, 1556-61, 1566-71, pm 1566-70.<br />\nEk 1553 Oluff Sorri 1 leiv. haukia, VA 130a f. 21 v. Ek 1554 Oluff Sorri 1 leiv., VA 1972. Ek 1555 Oluff Sorri 1 leiv., VA 1978. Ek 1556 Oluff Sorri 1 leiv., VA 1998.<br />\nSak tk 30.1.1558 Oluff Kulchas t &gt; omaa velje\u00e4\u00e4n Erkki\u00e4 (talo IIb), sk 31.12.1560 Oluff Kulkas t &gt; talon I Heikki Sorrin piika. Hv 1571 Sorrilaby: Oleff Kulkas ku 10, hev 2, le 7, nk 0-1-2-0, la 6, oa 123:2, ny 13.25.\"<br />\nL\u00e4hde: Seppo Suvanto: Satakunnan henkil\u00f6tiedosto 1303\u20131571, sivut 506-721 Pirkkala, latauslinkki:<br />\nhttps://portti.kansallisarkisto.fi/satakunta_sivut_0506-0721_pirkkala.pdf / Viitattu 13.8.2024\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
