"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.kangasalanseurakunta.fi/documents/7381005/8308090/Hautausmaainventointi+2006/381c61d8-2af0-b5a2-4c60-63680f7cb7c3<br />\n\"Vanha hautausmaa sijaitsee Kangasalan kivikirkon yhteydess\u00e4 sen etel\u00e4puolella muistuttaen muodoltaan neli\u00f6t\u00e4 siten, ett\u00e4 sen kaareva pohjoissivu on kiinni Kangasalantiess\u00e4...<br />\nHautausmaiden muotoutumiseen ovat vaikuttaneet monet lait ja asetukset. Er\u00e4s keskeisimmist\u00e4 on ollut terveydenhoitoa koskeva asetus vuodelta 1879. Siin\u00e4 kiinnitettiin huomiota muun muassa hautausmaiden terveydellisiin vaikutuksiin... vuonna 1812, Kerppolan ratsutilan haudan kirkkomaan keskell\u00e4 oli todettu olleen \u201dmatala ja rumentava\u201d, mink\u00e4 vuoksi se sittemmin m\u00e4\u00e4r\u00e4ttiin siirrett\u00e4v\u00e4ksi ja my\u00f6hemmin kokonaan poistettavaksi. My\u00f6s muilla Kangasalan kartanoilla ja isoilla taloilla on ollut sittemmin terveydelle vaarallisiksi todettuja ja poistettaviksi m\u00e4\u00e4r\u00e4ttyj\u00e4 hautarakennelmia.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=22273&amp;pnum=7\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\n\"Oriveden ym. talvik\u00e4r\u00e4j\u00e4t 9-.2.1964<br />\n VA Yl\u00e4-Satakunta KOa87 s. 71v-, mikrofilmi JK 1703<br />\n...<br />\ns. 86v # 31 - Trumslagaren wid kogl. lifdragone regementet Johan Dahl hade 6.7.1763 julii efter sluten marknad om aftonen i Orihwesi by slagits med skomakaren Johan R\u00f6nsberg. Dahl swarade, det han skadat R\u00f6nsberg med dess sabel i l\u00e5ret men p\u00e5stod s\u00e5dant skiedt af w\u00e5da under det R\u00f6nsberg med Dahl sk\u00e4mtat, hwilcket R\u00f6nsberg widgick.<br />\nAfledne l\u00e4nsmannen F\u00e5rsk\u00e5ls encka Sophia Forsk\u00e5ll fr\u00e5n Orihwesi by ber\u00e4ttade, at marknadsdagen seent om aftonen Dahl och R\u00f6nsberg emellan warit oenighet p\u00e5 Erola hemman, hwarefter witnet g\u00e5tt til dess boda. Sedan witnet derifr\u00e5n \u00e5terkommit, har R\u00f6nsberg m\u00f6tt henne och haltat.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
