"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Tuomiokirjapoiminnat1366-1878.pdf<br />\nSivu 65<br />\n\"Oriveden ja Kangasalan talvik\u00e4r\u00e4j\u00e4t 5-6.3.1675<br />\nVA Yl\u00e4-Satakunta KOa6 s. 64v-, mikrofilmi ES 1963 <br />\n... Clemet Larsson ifr\u00e5n Witikala by af J\u00e4mpse sochn k\u00e4rde till M\u00e5rten Johansson i Wilkil\u00e4 om det ryttarehemmanet han nu \u00e5bor, som skulle han Clemet \u00e5 sin hustrus w\u00e4gna wara der n\u00e4mbst arftagen. Clemets sw\u00e4rfader Ambrosius Sigfredsson hade f\u00f6r 40 \u00e5r sedan 2\u00bd \u00f6re skatt besuttit i Wilkil\u00e4. M\u00e5rtens fader sal. Johan Svensson tillhandlat 2 \u00f6re skatt af een blindh h:u Brita Olofsdotter 1633 och det andra hemmanet om 2\u00bd \u00f6re af een Johan Erichsson.\"\n</p>\n<p>\nSivu 263<br />\n\"Oriveden ja Kuoreveden talvik\u00e4r\u00e4j\u00e4t 10.3.1703 <br />\nOriveden kyl\u00e4n nimismiehentalossa<br />\nVA Yl\u00e4-Satakunta KOa23 s. 147v, mf ES 1972<br />\n..<br />\ns. 151 - M\u00e5rten Johansson i Wilkkil\u00e4 anh\u00f6lt afwittring efter hustro sahl. Walborg Bertilsdotter, 6 s\u00f6ner, 3 d\u00f6ttrar, alla myndige, f\u00f6r att tr\u00e4da i annat gifte.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
