"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.protsv.fi/ths/finne/tuomiokirjapoiminnat/Langelmaentuomiokirjoja.pdf<br />\n\"Laamannink\u00e4r\u00e4j\u00e4t 31.1. (1612) KA Etel\u00e4-Suomen LO 1, mf ES 1694<br />\ns 97v af Lengelmaa fierdungh i n\u00e4rwaru af Christopher Persson Lagl\u00e4sare<br />\nN\u00e4mpden: Eskell i Saueniemi, Simon \u00c4hwilax, Sigfredh \u00c4wij\u00e4rfui, Mattz Huicko, Erick Tagela, Enwald Leuaslaxi, Clemet Koppala, Erick Koroinen, Hinrick Kuifwasild, Grels Kylinoija, Mattz \u00c4hwilax, Per Lengilm\u00e4 Poija ...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
