"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://hannukaiset.fi/historiaa/<br />\nHannukaisten tulivat Viipurin pit\u00e4j\u00e4n Hannukkalan saareen oletettavasti 1500-luvun alussa. Avoimessa kirjeess\u00e4 vuodelta 1554 mainitaan Harisalmen Hannukaisia. Hannukkalan saari ja kyl\u00e4 kuuluivat my\u00f6hemmin Johanneksen pit\u00e4j\u00e4\u00e4n. Hannukaisten suvun miespuolisten j\u00e4senten nimi\u00e4 tunnetaan 1500-luvun alkupuolelta saakka, ja tunnetaan heid\u00e4n muuttohistoriaansa Johanneksen Hannukkalan kyl\u00e4st\u00e4 muun muassa Hiitolaan, Muolaaseen, Pyh\u00e4j\u00e4rvelle ja Sakkolaan. Pyh\u00e4j\u00e4rven Hannukaiset lienev\u00e4t 1500-luvun puoliv\u00e4liss\u00e4 Hannukkalan saaressa el\u00e4neen Laurin j\u00e4lkel\u00e4isi\u00e4. Pyh\u00e4j\u00e4rvelle muutti Hannukaisia 1610-luvulla, Antti Pekanpoika muutti Johanneksen Hannukkalasta J\u00e4\u00e4sken ja Ruokolahden kautta K\u00e4kisalmen l\u00e4\u00e4niin, h\u00e4n lienee Pyh\u00e4j\u00e4rvell\u00e4 vuodesta 1615 asunut Antti Hannukainen. Anna Hannukainen saattaa siis olla 1500-luvulla syntyneiden Laurin, Pekan ja Antin j\u00e4lkel\u00e4inen, mutta v\u00e4list\u00e4 puuttuu sukupolvi tai pari eik\u00e4 lapsi-vanhempi-suhteista ole sellaista tietoa ett\u00e4 voisi piirt\u00e4\u00e4 sukupuun Annasta vanhempiin p\u00e4in.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
