"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.tampere.fi/sites/default/files/2022-06/Aitolahden_kulttuuriymp%C3%A4rist%C3%B6inventointi.pdf<br />\n\"Laalahti tunnetaan yksin\u00e4istalona, jonka pihapiirin halkaisee nyky\u00e4\u00e4n maantie. Vuonna 1540 kyl\u00e4ss\u00e4 oli kaksi taloa, joista toinen n\u00e4ht\u00e4v\u00e4sti 1600-luvun alkupuolella liitettiin kantatilaan. Laalahtea is\u00e4nn\u00f6iv\u00e4t sep\u00e4t, jotka tunnettiin varsin varakkaina miehin\u00e4. Vuoden 1571 hopeaveroluettelon mukaan Heikki Sepp\u00e4 oli Aitolahden varakkain mies, jolla oli mm. 20 nautaa ja er\u00e4omistus \u00c4ht\u00e4riss\u00e4. 1600-luvulla Laalahti oli ratsumiestila, josta 1600-1700-lukujen vaihteen aikoihin tuli rustholli. Laalahti s\u00e4ilyi talonpoikaisomistuksessa ja sen augmentteja olivat Teiskon Kuoranta, Saarlahden L\u00f6yt\u00e4n\u00e4 sek\u00e4 Takahuhdin Huikas.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://fi.wikipedia.org/wiki/Tampereen_alueliitokset<br />\nJ\u00e4rvensivu liitettiin Tampereeseen vuonna 1922 Messukyl\u00e4st\u00e4.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://fi.wikipedia.org/wiki/Tampereen_alueliitokset<br />\nKytt\u00e4l\u00e4 liitettiin Tampereeseen vuonna 1877 Messukyl\u00e4st\u00e4.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://hiski.genealogia.fi/seurakunnat/srk?CMD=SRK&amp;ID=764&amp;TYPE=HTML&amp;LANG=FI\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.tampere.fi/sites/default/files/2022-05/taku_kulttuuriymparistoselvitys_2015.pdf\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAitolahti Sorila Kulkas 1500-1900-luvuilla<br />\nhttps://www.tampere.fi/sites/default/files/2022-05/taku_kulttuuriymparistoselvitys_2015.pdf<br />\n1500-luvulla Aitolahdella Sorilan kyl\u00e4\u00e4n taloja olivat mm. Sorri, Kulkas, Peukunen ja Korpehinen eli Korpi. Maakirjan mukaan Sorila oli v. 1540 kuusi tilaa: kaksi Juudasta, joista toista sanottiin Peukuseksi ja toinen h\u00e4visi pian, Pekka joka yhdistettiin toisiin 1500-luvun lopulla ja kaksi Sorria, joista toista sanottiin my\u00f6s Marttilaksi ja toinen yhdistettiin 1630-luvulla Kulkkaan kantatilaan, joka esiintyy maakirjassa vasta 1553. Sorrit pit\u00e4v\u00e4t Marttilaa ja Kulkasta, Olavi Juudas Peukusta ja Heikki Juudas seuraavalla vuosikymmenell\u00e4 h\u00e4vi\u00e4v\u00e4\u00e4 tilaa. Korpi, Rekola eli S\u00e4lli ja Utukka sis\u00e4ltyiv\u00e4t kaikki ensimm\u00e4iseen maakirjaan Sorilan kohdalla.\n</p>\n<p>\n1600-luvulla olivat rustholleja, ratsutiloja eli ratsumiestiloja Kulkas, Laalahti, V\u00e4rm\u00e4l\u00e4, Piril\u00e4, P\u00e4rri, Korpula, S\u00e4\u00e4ksniemi, Taulaniemi ja Kuoranta. Rustholli oli vauras maakirjatalo, joka varustaa ratsuv\u00e4keen yhden tai useamman ratsaan, johon kuuluu mies, hevonen ja varusteet.\n</p>\n<p>\nIsojakokartan mukaan v. 1764 ja 1857 Sorilan tiiiviin ryhm\u00e4kyl\u00e4n muodostivat Kulkas, Marttilat ja Korpi. 1860-luvulla Kalmakurjen myllyn omistaa Messukyl\u00e4n Kulkas, joka on tuolloin Teiskon ainoa veromylly.\n</p>\n<p>\n1920-luvulla Sorilan maanviljelystilat olivat Kulkas, Marttila ja siit\u00e4 1922 lohkottu Sorri, Korpi sek\u00e4 Peukunen ja siit\u00e4 lohkottu Per\u00e4l\u00e4. Sorilassa oli my\u00f6s 10 huvilaa ja 14 pient\u00e4 asumusta, mm. Puustelli ja Rajala. Ensimm\u00e4inen osuuskauppa aloitti Kulkkaan tilapirtiss\u00e4, josta se 1920\u201330-luvulla siirtyi edemm\u00e4s m\u00e4elle uuteen rakennukseen. My\u00f6hemmin maantien l\u00e4nsipuolellakin oli kauppa. Pohjois-H\u00e4meen Tietopuolinen Karjanhoitokoulu aloitti 1925 Kulkkaalla, jonka maille kansakoulun l\u00e4helle rakennettiin 1932 uusi rakennus karjanhoitokoulua varten.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nRaine Raitio: Neppenius, Neppenstr\u00f6m, Adler -suku, Tamsuku Vuosikirja 1992-07<br />\nhttps://www.tamsuku.fi/Vuosikirja1992-07.pdf<br />\n\"Nykyisen Kuhmalahden alueella on sijainnut kaksi ns. ratsutilaa, Vehkapuntarin Hinkkala ja Ison-Pennon Knaapi. Em. tiloista Knaapia ovat hallinneet talonpoikaiset omistajat, sen sijaan Hinkkala on ollut pitk\u00e4\u00e4n Neppius ja Neppenstr\u00f6m-nimi\u00e4 kantaneen aliupseerisuvun hallussa.<br />\nNimenkantajien osalta ko. suku on h\u00e4vinnyt Kuhmalahdelta. Hinkkalan rustholli on kuitenkin Rauhalahti l. Fransberg-nimist\u00e4 osaa lukuun ottamatta edelleen t\u00e4m\u00e4n suvun naiskantaisten sukuhaarojen hallussa.<br />\n...<br />\nSuvun juuret johtavat Kuhmalahden (ent. Sahalahden) Vehkaj\u00e4rven N\u00e4ppil\u00e4n taloon, joka on ollut suvun hallussa ainakin vuodesta 1600. Tuolloin taloa asui Simo Antinpoika Nebb. H\u00e4nen pojanpoikansa Yrj\u00e4n\u00e4 Antinpoika (k. 1697) omisti 1600-luvunpuoliv\u00e4list\u00e4 alkaen Kuhmalahden Vehkapuntarin Hinkkalan eli Kihlalan rusthollin. Yrj\u00e4n\u00e4 Antinpojan onnistui koota huomattava omaisuus. T\u00e4m\u00e4 lautamies ja Hinkkalan is\u00e4nt\u00e4 oli tiett\u00e4v\u00e4sti 1600-luvun loppupuolen vaurain talollinen Kuhmalahdella. Omaisuuttaan h\u00e4n oli kartuttanut mm. lainaanalla varojaan korkoa vastaan ja pit\u00e4m\u00e4ll\u00e4 kestikievaria.<br />\nH\u00e4nen poikansa Sigfrid Neppius (n. 1660-1697) kuuluu niihin harvoihin erikoistapauksiin H\u00e4meess\u00e4, joista oman pit\u00e4j\u00e4n talollisten pojista tuli kotiseutunsa pappeja. Varakas koti mahdollisti Sigfridin l\u00e4htemisen opintielle Turkuun. H\u00e4m\u00e4l\u00e4lsnuorukaisten opink\u00e4ynnin laajuus tuolloin 1600-luvulla Turun Akaternian perustamisesta vuodesta 1640 Isoonvihaan saakka oli vain 3 - 4 ylioppilasta vuodessa.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.tamsuku.fi/Vuosikirja1993-13.pdf<br />\n\"Laalahden kyl\u00e4ss\u00e4 oli alunperin kaksi taloa, jotka sitten 1600-luvulla yhdistettiin yhdeksi tilaksi. Molempien puoliskojen is\u00e4nn\u00e4t olivat seppi\u00e4 ja n\u00e4ist\u00e4 Heikki-sepp\u00e4 oli v. 1571 hopeaveroluettelon mukaan Aitolahden varakkain mies. H\u00e4nell\u00e4 oli karjaa yIi 20 nautayksikk\u00f6\u00e4, er\u00e4maaomistus \u00c4ht\u00e4riss\u00e4 ja yhteens\u00e4 omaisuutta 260 rnk. Laalahden osat yhdisti vuonna 1635 Heikki Mikonpoika ja silloin t\u00e4m\u00e4n koko manttaalin talon vuotuinen kylv\u00f6 oli 6 tynnyrinalaa eli noin 3 ha.<br />\nMolemmat puoliskot olivat ratsutiloja ja niist\u00e4 oli kummastakin, kuten my\u00f6s Kulkkaalta ja ja Nattarista, mies 30-vuotisessa sodassa hakkapelittana Torsten St\u00e5hlhansken joukoissa. Aluksi ratsumiehen\u00e4 toimi talon is\u00e4nt\u00e4 itse tai joku pojista, mutta 1640-luvulta alkaen t\u00e4h\u00e4n vaaralliseen toimeen hankittiin palkkamies.<br />\nLaalahti oli t\u00e4m\u00e4n alkusuvun hallussa aina vuoteen 1684, jolloin talon koko miesv\u00e4en kuoltua leskiem\u00e4nt\u00e4 myi sen 500 kuparitaaIerista Teivaalan Birkmanneille.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
