"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLainaus l\u00e4hteest\u00e4 https://www.geni.com/people/Antti-Karvia/6000000052937611906<br />\n\"Antti Klemetinpoika Karvia ... <br />\nLaamannink\u00e4r\u00e4j\u00e4t 29-30.1.1683.KA Etel\u00e4-Suomen LO 1, mf ES 1694 Arfwed Horn; uthi L\u00e4ngelm\u00e4 Sochn och Tungelois Lensmansg\u00e5rdh s 408 - Anders Clemetsson i Kyllinoija praesenterade een H\u00e4redzdohm af 5.7.1681, hwarf\u00f6rmedelst han som \u00e4lldre Broderens son blifwer framf\u00f6r den yngre brodrens Sahl. J\u00f6ran Erssons barn erk\u00e4ndt at wara n\u00e4rmare ber\u00e4ttigadh till prioriteten uthaf sit F\u00e4dernes B\u00f6rdehemmans i Kyllinoija besittningh; doch s\u00e5 att han Anders skulle f\u00f6rst erl\u00e4ggia till Cnut Thomasson ibm f\u00f6r des giorde f\u00f6rstrechningh till he mmanet 85 d:5 21 \u00f6re S:mt. Det inst\u00e4lte sig Cnut Thomassons, som f\u00f6rrest till N\u00e5rb\u00e5tn, hustro Margeta Lukasdotter medh sin moder till swars. Swarade dhe f\u00f6rstr\u00e4cht til sin Antecessor Sahl. J\u00f6ran Erichsson, denne Anders Clemetssons faderbroder . Cnut tagit \u00e4nckian Margeta Lukasdotter f\u00f6r 2\u00bd \u00e5hr sedan till hustro. Emedan R\u00e4tten befinner Anders Thomasson (= Clemetsson) wara f\u00f6rmedelst laga dohm af 5.7.1681 n\u00e4rmare ber\u00e4ttigat att besittia sit f\u00e4dernes B\u00f6rdehemman i Kyllinoija \u00e4n som hans faders yngre Broders Sahl. J\u00f6ran Erichssons barn, dy blifwer han - - tilltr\u00e4da. Cnut kom fulleligen bewijsa sigh f\u00f6r sit gifterm\u00e5hl medh Sahl. J\u00f6rans \u00e4ncka, till hemmanetz nytta - -.\n</p>\n<p>\nAntti Yrj\u00f6npoika Antti Klemetinpojan v\u00e4vy: Oriveden ym syysk\u00e4r. 1-4.9. 1738:<br />\ns. 29v, # 20 - B\u00f6nderne Anders J\u00f6ransson Karfwia och Erick Ericksson ifr\u00e5n Er\u00e4lax uti L\u00e4ngelm\u00e4 Sokn g\u00e5fwo tilk\u00e4nna, huru s\u00e5som den f\u00f6rras \u00e4n i lifwet warande Sw\u00e4rfaders Anders Clemetssons Fadersysters och den senares afl:ne Faders Systerdotter. ...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
