"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.geni.com/people/Lauri-Hokkanen/6000000011891143482<br />\n\"Lauri Hokkanen L\u00f6yt\u00e4n\u00e4ss\u00e4 1571-1603. L\u00f6yt\u00e4n\u00e4 Jaakko Heikinpojan v. 1571, my\u00f6hemmin Liuksialan r\u00e4lssi\u00e4. (Kankaanp\u00e4\u00e4 talonhaltijamatrikkeli teoksessa Jokipii jne Vanhan Ruoveden historia I:2 liiteosa 1990 s. 174)\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLainaus l\u00e4hteest\u00e4 https://www.geni.com/people/Liisa-Juhontyt%C3%A4r-M%C3%A4ntt%C3%A4-Rainio/6000000000699784451<br />\n\"... Seuraavasta k\u00e4y suoraan ilmi ett\u00e4 Lisa oli Abraham Abrahamsson Rainion is\u00e4n sisko:<br />\n\"KA mf. ES 1967 (nn 10) Karkun ja Mouhij\u00e4rven k\u00e4r\u00e4j\u00e4t 29.7.\u20131.8.1693 f. 350 (Hustru Lisbetta Johansdotter ifr\u00e5n Keuru Sochn och Mentz\u00e4 Byy k\u00e4rde nu som wedh senaste Winter Tingh till sin Brorson Abraham Abrahamson j Rainio om sin Arfzdehl efter sina F\u00f6r\u00e4ldrar Ib:m ... Ytterligare sade Abraham, att hans andra Fahrbrors dotter Hustru Brita Johansdotter j Jysi\u00e4 intet heller p\u00e5st\u00e5r sin r\u00e4tt utan den l\u00e5ter falla, hwilcket hon intet skulle gi\u00f6ra, der hon wiste sigh det ringaste fogh hafwa den att fordra, som och hans Fahrbrors Enckia Hustru Malin desererat sin klagan emedan hon l\u00e5tit Citera Abraham till detta Tingh, men hon sielf intet Comparerat utan twifwel af orsaak at hon weth sigh ingen r\u00e4ttm\u00e4tigh Saak hafwa att p\u00e5st\u00e5).\":<br />\nYlioppilasmatrikkeli 1640\u20131852, Henrik Rainenius] https://ylioppilasmatrikkeli.fi/henkilo.php?id=1022 / Viitattu 3.8.2024\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
