"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nL\u00e4hdeviitteit\u00e4 l\u00e4hteess\u00e4 https://www.geni.com/people/Mikko-Hokkanen/6000000019274994691<br />\n-\tAntero Manninen, Kangasniemen historia, osa 1 (1953) ~ Kangasniemen kylien vaiheita<br />\n-\tKirja Keuruun Hokkasen suku: Avustajat Juho Laesvuori, Tuomas Niilonpoika M\u00e4nts\u00e4n j\u00e4lkel\u00e4isten sukuseura Kustantaja Tuomas Niilonpoika M\u00e4nts\u00e4n j\u00e4lkel\u00e4isten sukuseura, 2003\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLainauksia l\u00e4hteest\u00e4 https://www.geni.com/people/Niilo-Hokkanen/6000000004184706080<br />\n\"... Ruoveden ja Keuruun k\u00e4r\u00e4jill\u00e4 19-20.6.1693 Edesmenneen Juho Heikinpoika Monosen appi Niilo Laurinpoika Hokkanen oli k\u00e4r\u00e4jill\u00e4 tytt\u00e4rens\u00e4 puolesta t\u00e4m\u00e4n perint\u00f6asiassa. Yl\u00e4-Satakunnan tuomiokunnan renovoidut tuomiokirjat - Varsinaisten asioiden p\u00f6yt\u00e4kirjat 1693-1693 (KO a:13), jakso 346, sivu 271; Kansallisarkisto:<br />\nhttps://astia.narc.fi/uusiastia/viewer/?fileId=8162927738&amp;aineistoId=1818965523 / Viitattu 18.10.2021\n</p>\n<p>\nRuoveden ja Keuruun k\u00e4r\u00e4jill\u00e4 15-17.9.1698 Pekka Pertunpoika Viinikka ja t\u00e4m\u00e4n lanko Niilo Laurinpoika Hokkanen esittiv\u00e4t, ett\u00e4 Pekan \u00e4iti ja Niilon anoppi Kerttu Matintyt\u00e4r kuoli 1697, jolloin j\u00e4\u00e4mist\u00f6 j\u00e4i j\u00e4i n\u00e4iden sisarenmiehelle lautamies Erkki Sipinpoika Tarhap\u00e4\u00e4lle. Yl\u00e4-Satakunnan tuomiokunnan renovoidut tuomiokirjat - Varsinaisten asioiden p\u00f6yt\u00e4kirjat 1698-1698 (KO a:18), jakso 286, sivu 268; Kansallisarkisto:<br />\nhttps://astia.narc.fi/uusiastia/viewer/?fileId=8162170423&amp;aineistoId=1819046534 / Viitattu 22.10.2021\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLainaus l\u00e4hteest\u00e4 https://www.geni.com/people/Olavi-Pauhari/6000000037470617156<br />\n\"Pauhari oli er\u00e4miestalo, jonka is\u00e4nt\u00e4 toimi lautamiehen\u00e4 Saarioisten k\u00e4r\u00e4jill\u00e4 mm. 13.2.1470. Taloa ei ollut maakirjoissa 1543-1551. Talo jaettiin veljesten kesken osiin. Is\u00e4nt\u00e4n\u00e4 1554-1580 toiminut Olavi Jussinpoika oli 1548-1569 lautamiehen\u00e4 38 kertaa, ja viel\u00e4 vuosina 1572-1578 117 kertaa.\n</p>\n<p>\nOlavi Pauhari Saarisilta omisti osan Vesangan er\u00e4maasta Jyv\u00e4skyl\u00e4n maalaiskunnassa. Maksingan lainhuudatusptk:jassa luetellaan kahdeksan myyj\u00e4\u00e4, joista yksi oli Urjalan Pauharin Olavi. 1589 Rautalammin tutkintak\u00e4r\u00e4j\u00e4t katselmustodistus Vesangan maista. Ne olivat aikoinaan olleet Saarioisten Tapani Matinpojan ja Olavi Pauharin omistamia. Pauharin is\u00e4nti\u00e4 tunnettiin 1470-luvulta l\u00e4htien er\u00e4talonpoikina ja lautamiehin\u00e4. (FMU3412) My\u00f6hemmin Pauharin talon l\u00e4heisyys kirkon kanssa aiheutti ongelmia. Pauhari nimitt\u00e4in rakensi kirkon maallekin, sill\u00e4 oli vaikea noudattaa rakennuskieltoa.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLainaus l\u00e4hteest\u00e4 https://www.geni.com/people/Olavi-Siurola/6000000040326887413<br />\n\"Sipi Olavinpoika Siurola ... Omisti Raikun kyl\u00e4ss\u00e4 Kangasalla 1/2 koukun suuruisen talon. Kun Kangasalla s\u00e4ilyi kauan aikaa tapana, ett\u00e4 nimismiehen virka ei ollut vakinainen, vaan hoiti sit\u00e4 joku talollinen, niin mainitsevat asiakirjat Olavi Tuurenpojan t\u00e4ss\u00e4 toimessa vuosina 1540 - 1543. Maakirja mainitsee h\u00e4net talollisena vuoteen 1556. Lautamiehen\u00e4 tavataan h\u00e4nen nimens\u00e4 viel\u00e4 04.06.1557. (Tampereen kaupungin arkisto, Jalmari Finnen arkisto, kansio VI:39 Kangasalan Raikusta) ...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
