"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLainaus l\u00e4hteest\u00e4 https://www.geni.com/people/Paavo-K%C3%B6mi/6000000000699786457<br />\n\"... Kuollut ilmeisesti my\u00f6hemmin kuin 1669, sill\u00e4 k\u00e4r\u00e4j\u00e4juttu helmikuulta 1675. Asutuksen yleisluettelossa viimeisen kerran 1674\n</p>\n<p>\nYl\u00e4-Satakunnan tuomiokunnan renovoidut tuomiokirjat - Varsinaisten asioiden p\u00f6yt\u00e4kirjat 1675-1678 (KO a:6, 1675, 1678), jakso 51, sivu 47: 25.-26.2.1675 Ruovesi ja Keuruu; Kansallisarkisto:<br />\nhttps://astia.narc.fi/uusiastia/viewer/?fileId=8162526908&amp;aineistoId=1818831531 / Viitattu 3.8.2024\n</p>\n<p>\nL\u00c4HDE: Vanhan Ruoveden Talonhaltijat Matrikkeli 1552-1809. Ilma Orkamon is\u00e4nt\u00e4luettelot 1552-1721 uudistanut ja t\u00e4ydent\u00e4nyt Matti J. Kankaanp\u00e4\u00e4. ISBN 952-90-2501-7. Gummerus Kirjapaino Oy. Jyv\u00e4skyl\u00e4 1990. Sivu 97. ...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
