"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLainaus l\u00e4hteest\u00e4 https://www.geni.com/people/Tuure-Lintula/6000000025860236711<br />\n\"... Naituaan Paalilan Lintulan ratsutilan tytt\u00e4ren sai h\u00e4n t\u00e4m\u00e4n kautta paitsi taloja suuren m\u00e4\u00e4r\u00e4n varallisuutta. H\u00e4n lainasi rahaa ja viljaa arvoesineit\u00e4 vastaan. Kun lainoja ei aina suoritettu, hankki Tuure lainhuudatuksen n\u00e4ille esineille. 22.10.1663 h\u00e4n huudatti kultasormuksen, kattilan ja raanun, jotka Margareeta Abrahamintyt\u00e4r oli pantannut nelj\u00e4\u00e4 viljatynnyri\u00e4 ja 16 talaria vastaan, sek\u00e4 hopeak\u00e4\u00e4dyt, jotka Simo Eskonpoika Franssilasta oli pantannut, viel\u00e4 kaksi vaippaa ja raanun, jotka Akseli Hannunpoika Turolan Tavelasta oli pantannut yht\u00e4 ruistynnyri\u00e4 vastaan, lis\u00e4ksi kattilan, jonka Perttu Matinpoika Haapaniemen Mikkolasta oli pantannut nelj\u00e4\u00e4 ruistynnyri\u00e4 vastaan. 23.09.1678 h\u00e4n k\u00e4r\u00e4j\u00f6i kahdesta ruistynnyrist\u00e4, jotka Heikki Jaakonpoika Tarpilasta oli 5 vuotta aikaisemmin lainannut. 06.03.1682 h\u00e4n vaati Matti Mikonpojalta Heponiemen Melkkaalta yht\u00e4 tynnyri\u00e4 7 1/2 kappaa viljaa. 17.06.1681 h\u00e4n vaati parilta miehelt\u00e4 lainaamaansa ruista. 30.09.1685 h\u00e4nelle tuomittiin 12 luotia painava hopeapikari, jota vastaan h\u00e4n oli lainannut 19 talaria ja kaksi tynnyri\u00e4 viljaa majoitusmestari Jaakko Mikonpojalle Tyrv\u00e4\u00e4n Monaalasta. Paitsi Lintulaa kuului Tuurelle Karvalan talo samassa kyl\u00e4ss\u00e4. T\u00e4m\u00e4n h\u00e4n myi 206 talarista 08.07.1672 Juho Mikonpojalle, joka oli Turen sisaren tytt\u00e4ren poika. Juho maksoi heti 106 talaria, mutta tinki 06.03.1682 loppusummasta pois 50 talaria, mihin Tuure suostui. (Tampereen kaupungin arkisto, Jalmari Finnen arkisto, kansio VI:39 Kangasalan Raikusta)\n</p>\n<p>\nIs\u00e4nt\u00e4n\u00e4 1650 - 1678. L\u00e4hde: Liisa Poppius, Talot ja is\u00e4nn\u00e4t, s. 237 - 303. Teoksessa L\u00e4ngelm\u00e4veden seudun historia II. Kangasalan historia II. H\u00e4meenlinna 1954.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
