"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.urjala.fi/client/urjala/userfiles/1019-raportti-rakennusinventointi-valmis.pdf<br />\n\"Laukeelan kyl\u00e4n talot l\u00e4\u00e4nitettiin Klaus Skarpenfeltille 1650. H\u00e4nen poikansa Gustav muutti 1663 Laukeealan Uotilaan, jolle h\u00e4n sai s\u00e4terivapauden 1670, kartanoon liitettiin yksi kyl\u00e4n taloista. Lyhytaikainen s\u00e4terikartano jakaantui 1700-luvulla moneen osaan. Laukeelan talom\u00e4\u00e4r\u00e4 kasvoi muutenkin 1700-luvun puoliv\u00e4lin j\u00e4lkeen ollen yhdeks\u00e4n vuonna 1830. My\u00f6hemmin Nuutaj\u00e4rven kartano yhdisti maihinsa kaksi kyl\u00e4n taloa (Keppil\u00e4t), ja perusti yhden sivutilan, K\u00f6ppil\u00e4n, kirkon etel\u00e4puolelle pienten lampien v\u00e4lill\u00e4 kulkevan harjun kupeelle.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
